class Solution(object):
    def minimumObstacles(self, grid):
        """
        :type grid: List[List[int]]
        :rtype: int
        """
        # pre-process
        M = len(grid)
        N = len(grid[0])
        DIRECTIONS = ((1, 0), (-1, 0), (0, 1), (0, -1))

        # helper function
        # travel air - find all obstacles connected by air
        def travelAir(sx, sy, visited):
            # shortcut
            if sx == M - 1 and sy == N - 1:
                return [(sx, sy)]
            # bfs
            from collections import deque
            from collections import deque
            bfs = deque()
            bfs.append((sx, sy))

            nodes = list()
            while bfs:
                x, y = bfs.popleft()
                for dx, dy in DIRECTIONS:
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < M and 0 <= ny < N:
                        if not visited[nx][ny]:
                            if nx == M - 1 and ny == N - 1:
                                nodes.append((nx, ny))
                            if grid[nx][ny] == 1:
                                nodes.append((nx, ny))
                            else:
                                visited[nx][ny] = True
                                bfs.append((nx, ny))
            return nodes

        # process
        # bfs
        from collections import deque
        bfs = deque()
        bfs.append((0, 0))
        visited = [[False] * N for _ in range(M)]
        visited[0][0] = True

        steps = 0
        while bfs:
            size = len(bfs)
            for _ in range(size):
                x, y = bfs.popleft()
                for dx, dy in DIRECTIONS:
                    nx, ny = x + dx, y + dy
                    if 0 <= nx < M and 0 <= ny < N:
                        if not visited[nx][ny]:
                            if grid[nx][ny] == 1:
                                visited[nx][ny] = True
                                bfs.append((nx, ny))
                            else:
                                nodes = travelAir(nx, ny, visited)
                                # print(nodes)
                                for nnx, nny in nodes:
                                    if nnx == M - 1 and nny == N - 1:
                                        return steps
                                    else:
                                        visited[nnx][nny] = True
                                        bfs.append((nnx, nny))
            steps += 1


