import random
def generate_random_matrix(rows, cols):
    matrix = []
    for _ in range(rows):
        row = [random.randint(0, 1) for _ in range(cols)]
        matrix.append(row)
    matrix[0][0] = 0
    matrix[rows - 1][cols - 1] = 0
    return matrix

